import React from "react";
import ReactDom from "react-dom";
// import App from "./components/App";

function Card(props){
    return (<div>
        <h2>{props.name}</h2>
        {/* <img src={props.img} alt="avatar"/> */}
        <p>{props.tel}</p>
        <p>{props.email}</p>
    </div>);
}

ReactDom.render(
    <div>
        <Card name="test" tel="1234" email="ee@d.com"/>
    </div>,document.getElementById("root"));
